import React from "react";
import { View } from "react-native";
import avatar from "../../../assets/avatar.png";
import {
  Container,
  Header,
  Title,
  Card,
  CardHeader,
  Avatar,
  Description,
  Bold
} from "./styles";

const Activitites = () => {
  return (
    <Container>
      <Header>
        <Title>Atividades</Title>
      </Header>

      <Card>
        <CardHeader>
          <Avatar source={avatar} />
          <Description>
            <Bold>Você</Bold> pagou a <Bold>@lucaslop</Bold>
          </Description>
        </CardHeader>

        <CardBody>
          <UserName>LucasLopes</UserName>
        </CardBody>
      </Card>
    </Container>
  );
};

export default Activitites;
